import Header from '../components/header';
import '../css/site.css'

const Layout = props => (
    <div className='layoutStyle'>

        <style global jsx>{`
        html {
            width:100%;
            height:100%;
            background: url("../static//images/bg.jpg") no-repeat;
        }
      `}</style>

        <Header />
        {props.children}
    </div>
);

export default Layout;
